create table quests_rewards
(
    Id                      int auto_increment
        primary key,
    StepId                  int        not null,
    LevelMin                int        not null,
    LevelMax                int        not null,
    ItemsRewardCSV          mediumtext null,
    ItemQuantitiesRewardCSV mediumtext null,
    EmotesRewardCSV         mediumtext null,
    JobsRewardCSV           mediumtext null,
    SpellsRewardCSV         mediumtext null
)
    engine = MyISAM
    charset = utf8;

